shoppingCart = [];
errors = [];
errorMessage = '<i class="fa fa-exclamation-circle" aria-hidden="true"></i>';
validations = {
    name: false,
    price: false,
    seller: false,
    url: false,
    description: false,
    quantity: false
};
function enableButton() {
    console.log(errors.length);
    if (
        validations.name === true &&
        validations.price === true &&
        validations.seller === true &&
        validations.url === true &&
        validations.description === true &&
        validations.quantity === true
    ) {
        $('#addSellItem').removeAttr('disabled');
    } else {
        $('#addSellItem').attr('disabled', true);
    }
    if (errors.length >= 1) {
        $('#errors').html(errorMessage + errors[0]);
    } else {
        $('#errors').html('');
    }
}
function itemInCart(item) {
    for (i = 0; i < shoppingCart.length; i++) {
        if (
            shoppingCart[i].name === item.name &&
            shoppingCart[i].price === item.price &&
            shoppingCart[i].inStock === item.inStock &&
            shoppingCart[i].description === item.description &&
            shoppingCart[i].picUrl === item.picUrl &&
            shoppingCart[i].seller === item.seller
        ) {
            return true;
        }
    }
    return false;
}
function addToCart(number) {
    INVENTORY[number].inStock -= 1;
    if (itemInCart(INVENTORY[number])) {
        shoppingCart[shoppingCart.indexOf(INVENTORY[number])].quantity += 1;
    } else {
        INVENTORY[number].quantity = 1;
        shoppingCart.push(INVENTORY[number]);
    }
    console.log(shoppingCart);
}
function removeFromCart(number) {
    INVENTORY[number].inStock += 1;
    shoppingCart.splice(shoppingCart.indexOf(INVENTORY[number]), 1);
}
function hideSellForm() {
    $('#toggleSellForm').html(
        'Add item to sell <i class="fa fa-plus" aria-hidden="true"></i>'
    );
    $('#toggleSellForm').css('color', 'black');
    $('#itemName')
        .attr('hidden', 'true')
        .val('');
    $('#itemPrice')
        .attr('hidden', 'true')
        .val('');
    $('#itemUrl')
        .attr('hidden', 'true')
        .val('');
    $('#itemDescription')
        .attr('hidden', 'true')
        .val('');
    $('#itemQuantity')
        .attr('hidden', 'true')
        .val('');
    $('#addSellItem')
        .attr('hidden', 'true')
        .val('');
    $('#itemSeller')
        .attr('hidden', 'true')
        .val('');
}
function showSellForm() {
    $('#toggleSellForm').html(
        'Cancel <i class="fa fa-minus" aria-hidden="true"></i>'
    );
    $('#toggleSellForm').css('color', 'red');
    $('#data').html('');
    $('#itemName').removeAttr('hidden');
    $('#itemPrice').removeAttr('hidden');
    $('#itemUrl').removeAttr('hidden');
    $('#itemDescription').removeAttr('hidden');
    $('#itemQuantity').removeAttr('hidden');
    $('#addSellItem').removeAttr('hidden');
    $('#itemSeller').removeAttr('hidden');
}
function back() {
    drawItems();
    $('#toggleSellForm').show();
}
function seeInfo(number) {
    $('#cart').html(
        '<i class="fa fa-shopping-cart" aria-hidden="true">' +
            shoppingCart.length
    );
    addTo = '';
    remove = 'disabled';
    if (shoppingCart.includes(INVENTORY[number])) {
        remove = '';
    }
    if (INVENTORY[number].inStock === 0) {
        classes =
            ' soldout"><center><img id="toplayer" src="http://www.pngall.com/wp-content/uploads/2016/06/Sold-Out-PNG-HD.png"><img id="bottomlayer" src="';
        addTo = 'disabled';
    } else {
        classes = '"><center><img src="';
    }
    console.log('seeInfo(' + number + ') has been clicked');
    $('#toggleSellForm').hide();
    $('#data').html(
        '<div class="row"><button onclick="back()">Back</button></div><p><div class=" row bigphoto' +
            classes +
            INVENTORY[number].picUrl +
            '"></center></div><div class="row"><p>' +
            INVENTORY[number].name +
            '<br>$' +
            INVENTORY[number].price +
            '<br>Seller: ' +
            INVENTORY[number].seller +
            '<br>In Stock: ' +
            INVENTORY[number].inStock +
            '<br>Description : ' +
            INVENTORY[number].description +
            '</p><br><button id="addToCart' +
            number +
            '" onclick="addToCart(' +
            number +
            '); seeInfo(' +
            number +
            ');" ' +
            addTo +
            '>Add to Cart<button id="removeFromCart' +
            number +
            '" onclick="removeFromCart(' +
            number +
            '); seeInfo(' +
            number +
            ');"' +
            remove +
            '>Remove from cart</button></div></div>'
    );
}
function drawItems() {
    $('#cart').html(
        '<i class="fa fa-shopping-cart" aria-hidden="true">' +
            shoppingCart.length
    );
    html = '';
    for (i = 0; i < INVENTORY.length; i++) {
        addTo = '';
        remove = 'disabled';
        if (shoppingCart.includes(INVENTORY[i])) {
            remove = '';
        }
        if (INVENTORY[i].inStock === 0) {
            classes =
                ' soldout"><img id="toplayer" src="http://www.pngall.com/wp-content/uploads/2016/06/Sold-Out-PNG-HD.png"><img id="bottomlayer" src="';
            addTo = 'disabled';
        } else {
            classes = '"><img src="';
        }
        if (i == 0) {
            html += '<div class="row">';
        }
        if (i % 3 == 0) {
            html += '</div><div class="row">';
        }
        html +=
            '<div class="col-sm-4"><div class="photo' +
            classes +
            INVENTORY[i].picUrl +
            '"></div><p>' +
            INVENTORY[i].name +
            '<br>$' +
            INVENTORY[i].price +
            '<br>In Stock: ' +
            INVENTORY[i].inStock +
            '<br><button id="addToCart' +
            i +
            '" onclick="addToCart(' +
            i +
            '); drawItems();" ' +
            addTo +
            '>Add to Cart<button id="removeFromCart' +
            i +
            '" onclick="removeFromCart(' +
            i +
            '); drawItems();"' +
            remove +
            '>Remove from cart</button><button id="info' +
            i +
            '" onclick="seeInfo(' +
            i +
            ')">More info</button></div></p>';
    }
    $('#data').html(html);
}
function removeItem(number) {
    INVENTORY[INVENTORY.indexOf(shoppingCart[number])].inStock += 1;
    shoppingCart.splice(number, 1);
    showCart();
}
function showCart() {
    $('#toggleSellForm').hide();
    total = 0;
    html = '<button onclick="back()">Back</button>';
    for (i = 0; i < shoppingCart.length; i++) {
        if (shoppingCart[i].inStock === 0) {
            classes =
                ' soldout"><img id="toplayer" src="http://www.pngall.com/wp-content/uploads/2016/06/Sold-Out-PNG-HD.png"><img id="bottomlayer" src="';
            addTo = 'disabled';
        } else {
            classes = '"><img src="';
        }
        html +=
            '<hr><div class="cart-item"><div class="photo' +
            classes +
            shoppingCart[i].picUrl +
            '"></div><p>' +
            shoppingCart[i].name +
            '<br>$' +
            shoppingCart[i].price +
            '<br>In Stock: ' +
            shoppingCart[i].inStock +
            '<br>Quantity: ' +
            shoppingCart[i].quantity +
            '<br><button onclick="removeItem(' +
            i +
            ')">Remove</button></p></div>';
        total += parseFloat(shoppingCart[i].price);
    }
    $('#data').html(html + '<br>Total: ' + total);
}
function toggleSellForm() {
    if ($('#toggleSellForm').css('color') === 'rgb(0, 0, 0)') {
        showSellForm();
    } else if ($('#toggleSellForm').css('color') === 'rgb(255, 0, 0)') {
        hideSellForm();

        drawItems();
    }
}
function sell() {
    item = {
        name: $('#itemName').val(),
        price: $('#itemPrice').val(),
        inStock: $('#itemQuantity').val(),
        description: $('#itemDescription').val(),
        picUrl: $('#itemUrl').val(),
        seller: $('#itemSeller').val()
    };
    INVENTORY.push(item);
    hideSellForm();
    drawItems();
}

$('#itemName').on('input', function(event) {
    var name = event.currentTarget.value;
    console.log($('#itemName').val());
    if (name === '') {
        errors.push(' Name is blank');
        validations.name = false;
    } else {
        if (errors.includes(' Name is blank')) {
            errors.splice(errors.indexOf(' Name is blank'), 1);
        }
        validations.name = true;
    }

    enableButton();
});
